import React from 'react';
import {ReactDadata} from "react-dadata";

let items = [
    { id: 0, value: 'ruby' },
    { id: 1, value: 'javascript' },
    { id: 2, value: 'lua' },
    { id: 3, value: 'go' },
    { id: 4, value: 'julia' }
]

const CalculateForm =(props)=>{
    return <div>
        <Autocomplete
            getItemValue={(item) => item.value}/>
            </div>
}
export default CalculateForm;
